import { TransactionProvider } from '../contexts/TransactionContext';
import AddTransaction from './AddTransaction';
import TransactionList from './TransactionList'


const Transaction = () => {
    return (
        <div>
            <TransactionProvider>
                <TransactionList />
                <AddTransaction />
            </TransactionProvider>
        </div>
    )
}

export default Transaction;
